import React from 'react'
import { Accordion, Card } from "react-bootstrap";

export const Acordeon = ({params}) => {

    console.log(params.Tabs);

    return (
        <Accordion>
            {
                params.Tabs.map(tab => (
                    <div>
                        <Accordion.Toggle as={Card.Header} eventKey={tab.id}>
                            {tab.Titulo}
                        </Accordion.Toggle>
                        <Accordion.Collapse eventKey={tab.id}>
                            {tab.Contenido}
                        </Accordion.Collapse>
                    </div>
                ))
            }
        </Accordion>
    )
}
